  false,\n\t\"url\": null,\n\t\"notes\": \"Attached is the final project report for
  the cooperative research study on lead exposure for black ducks in Tennessee. Research
  objectives included determining the current prevalence of blood lead exposure in
  adult black ducks wintering in Tennessee, and comparing current prevalence of blood
  lead exposure to prevalence obtained during 1986-88. In summary, it was found that
  during the last 10 years, lead exposure has declined by approximately 50% in adult
  black ducks during the last 10 years. However, lead exposure has not declined in
  juvenile birds. Periodic monitoring of juvenile black ducks may be needed to determine
  whether lead exposure remains high in this age class and whether further research
  is needed to address this issue.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
